import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
  return (
    <div className="Home">
      <header className="App-header">
        <h1>Welcome to My React App</h1>
        <p>This is a basic React application.</p>
        <Link to="/login" className="signin-button">Sign In</Link>
      </header>
    </div>
  );
}

export default Home;
